@Component({
    selector: "my-app",
    templateUrl: "./app.component.html"
    // template: "<h2>Angular has been started</h2>"
})
export class AppComponent {
  title: string = "Angular 15v";
}
<h2>Angular has been started</h2>
<h3>Bill Gates</h3>
<ul>
  <li><q>Patience is a key element of success</q></li>
  <li><q>If you think your teacher is tough, wait till you get a boss</q></li>
  <li><q>Life is not fair — get used to it!</q></li>
  <li><q>Success is a lousy teacher. It seduces smart people into thinking they can't lose</q>
  </li>
  <li><q>Benicetonerds.Chancesareyou'llendupworkingforone</q></li>
</ul>
